import './App.css';
import {
  browserHistory,
  Router,
  Route,
} from "react-router";


import Login from './pages/Login';
import Register from './pages/Register';

function App() {
  return (
    <Router>
      <Route path="/"><Login /></Route>
      <Route path="/register"><Register /></Route>
  </Router>
  );
}

export default App;
